function Graph(props) {
  const { data, xaxisLabels } = props;
  xaxisLabels.push(['overall']);

  console.log(xaxisLabels);

  const xaxisVals = [];
  for (let i = 0; i < xaxisLabels.length; i += 1) {
    xaxisVals.push(i);
  }

  console.log(xaxisVals);

  /* const colors = [
    'hsl(198.9, 100%, 57.1%)',
    'rgb(150, 22, 44)',
    'rgb(194, 155, 26)',
    'rgb(115, 155, 22)',
    '#9c27b0',
    '#3f51b5',
  ]; */

  /* const colors = [
    '#a9a9a9',
    '#e6194B',
    '#f58231',
    '#ffe119',
    '#bfef45',
    '#3cb44b',
    '#42d4f4',
    '#4363d8',
    '#911eb4',
    '#f032e6',
  ]; */

  const colors = [
    '#a9a9a9',
    '#fabebe',
    '#ffd8b1',
    '#f032e6',
    '#800000',
    '#469990',
    '#000075',
    '#8c0000',
    '#e6beff',
  ];

  let yMin = Infinity;
  let yMax = 0;

  function getPlotdata(item) {
    const yaxis = {};
    Object.keys(item).forEach((pipe) => {
      const y = [];
      let sum = 0;
      const values = Object.keys(item[pipe]);
      values.forEach((pair) => {
        const val = item[pipe][pair];
        y.push(val);
        sum += val;
        if (val < yMin) {
          yMin = val;
        }
        if (val > yMax) {
          yMax = val;
        }
      });
      y.push(sum / values.length);
      console.log(y);
      yaxis[pipe] = y;
    });

    const plotdata = [];
    Object.keys(yaxis).forEach((pipe) => {
      if (pipe === '1') {
        plotdata.push(
          {
            x: xaxisVals,
            y: yaxis[pipe],
            type: 'scatter',
            fill: 'tozeroy',
            marker: { color: colors[pipe - 1] },
            name: 'Benchmark',
          },
        );
      } else {
        plotdata.push(
          {
            x: xaxisVals,
            y: yaxis[pipe],
            type: 'scatter',
            marker: { color: colors[pipe - 1] },
            name: `Pipeline ${pipe}`,
          },
        );
      }
    });

    console.log(plotdata);
    return plotdata;
  }

  const amounts = {
    0: 'Label-, User- & Text-',
    1: 'Label- & User-',
    2: 'Label-',
  };

  function getGraphTitle(index) {
    let amount = '';
    if (Object.keys(data).length > 1) {
      amount = `with ${amounts[index]}Tags`;
    }

    return `Testset 1 ${amount} - NDCG`;
  }

  const offset = 0.02;

  return (
    <div className="Graphs">
      {Object.keys(data).map(item => (
        <Plot
          data={getPlotdata(data[item])}
          layout={
            {
              width: 700,
              height: 400,
              title: getGraphTitle(item),
              xaxis: {
                tickvals: xaxisVals,
                ticktext: xaxisLabels,
              },
              yaxis: {
                range: [yMin - offset, yMax + offset],
              },
            }
          }
        />
      ))}
    </div>
  );
}

