class EvaluationAnalysis extends Component {
  constructor(props) {
    super(props);

    this.state = {
      files: props.location.state.files,
      allFiles: [],
      filesRead: 0,
      combinedFiles: {},
      finishedInput: false,
      testSet: props.location.state.testSet,
      searchterms: props.location.state.testSet.test_words,
      searches: {},
      finishedSearch: false,
      result: {},
      stopBuilding: false,
      manuallySearch: true,
      savedSearches: [
        LabelUserTextSearch,
        LabelUserSearch,
        LabelSearch,
      ],
    };
  }

  componentDidMount() {
    this.readFiles();
    this.misspellSearch();
  }

  async componentDidUpdate() {
    const {
      finishedInput,
      finishedSearch,
      combinedFiles,
      stopBuilding,
    } = this.state;

    if (Object.keys(combinedFiles).length !== 0 && !finishedInput) {
      this.getGoldenSet();
    }

    if (finishedSearch && finishedInput && !stopBuilding) {
      console.log('finished search and input');
      this.calculateNDCG();
    }
  }

  misspellSearch = () => {
    
  };

  getRanking = () => {
    const { searches, manuallySearch, savedSearches } = this.state;
    const final = [];

    console.log(searches);

    if (manuallySearch) {
      const ranking = Object.assign({}, searches);

      Object.keys(searches).forEach((item) => {
        Object.keys(searches[item]).forEach((pipe) => {
          ranking[item][pipe] = searches;
        });
      });
      final.push(ranking);
    } else {
      savedSearches.forEach((item) => {
        final.push(Object.assign({}, item));
      });
    }

    console.log(final);

    return final;
  };

  calculateDCG = (ranking, combinedFiles) => {
    let index = 1;
    let sum = 0;

    ranking.forEach((id) => {
      const prio = (combinedFiles[id] - 1);
      const div = Math.log(index + 1);
      const val = prio / div;
      sum += val;
      index += 1;
    });

    return sum;
  }

  calculateIDCG = (ranking, combinedFiles) => {
    let index = 1;
    let sum = 0;
    const scores = [];

    console.log(ranking);

    ranking.forEach((id) => {
      scores.push([id, combinedFiles[id] - 1]);
    });

    scores.sort((first, second) => second[1] - first[1]);

    scores.forEach((id) => {
      const prio = (id[1] - 1);
      const div = Math.log(index + 1);
      const val = prio / div;
      sum += val;
      index += 1;
    });

    return sum;
  }

  calculateNDCG = () => {
    const result = {};
    const rankings = this.getRanking();
    const { combinedFiles } = this.state;
    let index = 0;

    console.log(rankings);

    rankings.forEach((ranking) => {
      console.log(ranking);
      console.log(rankings[ranking]);
      result[index] = {};

      Object.keys(ranking).forEach((item) => {
        console.log(item);
        console.log(ranking[item]);
        Object.keys(ranking[item]).forEach((pipe) => {
          console.log(pipe);
          console.log(ranking[item][pipe]);
          const idcg = this.calculateIDCG(ranking[item][pipe], combinedFiles[item]);
          const dcg = this.calculateDCG(ranking[item][pipe], combinedFiles[item]);
          const ndcg = dcg / idcg;

          result[index] = {
            ...result[index],
            [pipe]: {
              ...result[index][pipe],
              [item]: ndcg,
            },
          };
        });
      });

      this.setState({
        result,
      });

      index += 1;
    });

    this.setState({
      stopBuilding: true,
    });

    console.log('finished calculations');
  };

  makeSearch = async (searchterms) => {

    console.log('MAKE SEARCH WAS CALLED');

    const team = this.state.testSet.team_id;
    const len = searchterms.length - 1;
    let index = 0;
    console.log(len);
    console.log(searchterms);
    console.log(searchterms[len-1]);

    while (index < len) {
      console.log(index);
      console.log(searchterms[index]);
      const search = await this.search(searchterms[index], team);
      console.log(search);
      index = index + 1;
    }

    console.log('actual final');
    console.log('>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>');
    console.log(this.state.searches);
    console.log('<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<<');
    
    Object.keys(this.state.searches).forEach((item) => {
      console.log(item);
      console.log(this.state.searches[item]);
    });

    this.setState({
      finishedSearch: true,
    });
  };

  search = async (item, team) => {
    console.log('--SEARCH WAS CALLED');
    const search = item.split(',');
    const pipelines = 7;

    for (let i = 1; i <= pipelines; i += 1) {
      const pipeline = i;
      let result = [];

      result = await EvaluationService.get({
        search,
        teamId: team,
        limit: 1000,
        offset: 0,
        pipeline,
      });

      const filteredImages = result.images
        .filter(image => image.score === undefined || image.score > 0);

      const pipelineResult = Object.assign({}, this.state.searches[pipeline]);
      pipelineResult[item] = {};

      filteredImages.forEach((image) => {
        pipelineResult[item][image.id] = image.score;
      });

      this.setState(prevState => ({
        searches: {
          ...prevState.searches,
          [pipeline]: pipelineResult,
        },
      }), () => {
        console.log(this.state.searches);
      });
    }

    console.log(this.state.searches);
    return true;
  }

  readFiles = () => {
    for (let i = 0; i < this.state.files.length; i += 1) {
      this.setupReader(this.state.files[i]);
    }
  };

  setupReader = (file) => {
    const reader = new FileReader();
    reader.onload = (e) => {
      const object = JSON.parse(e.target.result);
      this.setState(prevState => ({
        allFiles: [...prevState.allFiles, object],
      }));
    };
    reader.onloadend = () => {
      this.setState(prevState => ({
        filesRead: prevState.filesRead + 1,
      }), () => {
        if (this.state.filesRead >= this.state.files.length) {
          this.combineSets();
        }
      });
    };
    reader.readAsText(file);
  };

  combineSets = () => {
    const { allFiles, manuallySearch } = this.state;
    const searchterms = [];
    let count = 0;

    allFiles.forEach((file) => {
      console.log(file);
      console.log(Object.keys(file));
      console.log(Object.keys(file).length);
      Object.keys(file).forEach((item) => {
        console.log(item);
        console.log(count);
        if (count < Object.keys(file).length) {
          searchterms.push(item);
          count += 1;
        }
        console.log(searchterms);
        Object.keys(file[item]).forEach((image) => {
          this.setState((prevState) => {
            const counts = prevState.combinedFiles[item] && prevState.combinedFiles[item][image]
              ? prevState.combinedFiles[item][image]
              : [];
            counts.push(file[item][image]);

            return {
              combinedFiles: {
                ...prevState.combinedFiles,
                [item]: {
                  ...prevState.combinedFiles[item],
                  [image]: counts,
                },
              },
            };
          });
        });
        if (count >= Object.keys(file).length && manuallySearch) {
          this.makeSearch(searchterms);
          count += 1;
        }
        if (count >= Object.keys(file).length && !manuallySearch) {
          this.setState({
            finishedSearch: true,
          });
        }
      });
    });
  }

  calculateKappa = (count) => {
    let sum = 0;
    count.forEach((item) => {
      sum += item;
    });
    const avg = sum / count.length;
    return avg;
  };

  getGoldenSet = () => {
    const { combinedFiles } = this.state;
    const result = {};
    Object.assign(result, combinedFiles);

    Object.keys(result).forEach((searchterm) => {
      Object.keys(result[searchterm]).forEach((item) => {
        const count = result[searchterm][item];
        const average = this.calculateKappa(count);
        result[searchterm][item] = average;
      });
    });

    this.setState({
      combinedFiles: result,
      finishedInput: true,
    });
  }

  handlePipelineInput = (e) => {
    console.log(e);
  }

  render() {
    const {
      combinedFiles,
      searches,
      finishedInput,
      finishedSearch,
      result,
      searchterms,
      stopBuilding,
    } = this.state;

    // console.log(combinedFiles);

    return (
      <div className="EvaluationAnalysis">
        {(!finishedInput || !finishedSearch) && (
          <img src={loading} className="EvaluationAnalysis__loading" alt="loading..." />
        )}
        {finishedInput && finishedSearch && stopBuilding &&(
          <div className="EvaluationAnalysis__graph">
            <Graph
              data={result}
              xaxisLabels={searchterms}
            />
          </div>
        )}
      </div>
    );
  }
}

export default connect()(EvaluationAnalysis);
